  true,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Department of Energy (DOE) Office
  of Indian Energy Policy and Programs, or the Office of Indian Energy, is charged
  by Congress to direct, foster, coordinate, and implement energy planning, education,
  management, and programs that assist tribes with energy development, capacity building,
  energy infrastructure, energy costs, and electrification of Indian lands and homes.rnrnThe
  Office of Indian Energy works within DOE, across government agencies, and with Indian
  Tribes and organizations to promote Indian energy policies and initiatives. The
  Office of Indian Energy performs these functions within the scope of DOE's mission
  and consistently with the federal government's trust responsibility, tribal self-determination
  policy, and government-to-government relationship with Indian Tribes.\",\n\t\"license_title\":
